var import_obsidian5 = require("obsidian");

// src/utils/splitContent.ts
var SplitContent = class {
  constructor(content) {
    this.content = content;
    this.sContent = content.split("\n");
  }
  searchLines(s, i2) {
    return s.substring(s.substring(0, i2).lastIndexOf("\n") + 1, i2 + s.substring(i2).indexOf("\n"));
  }
  search(offset5, context) {
    let content = "";
    if (!context)
      content = this.searchLines(this.content, offset5);
    else {
      content = this.searchLines(this.content, offset5);
      const matchLine = this.sContent.findIndex((item) => item.startsWith(content));
      if (matchLine === 0) {
        content = this.sContent.slice(0, 2).filter((i2) => i2 && i2.trim()).join("<br>");
      } else {
        content = this.sContent.slice(matchLine - 1, matchLine + 1).filter((i2) => i2 && i2.trim()).join("<br>");
      }
    }
    return content;
  }
};

