var OmniSearchItem = class {
  constructor(parent, path, foundWords, matches) {
    this.parent = parent;
    this.path = path;
    this.foundWords = foundWords;
    this.matches = matches;
  }
  async onload() {
    const wbOmniSearchItemEl = this.parent.createEl("div", {
      cls: "wb-omni-item"
    });
    wbOmniSearchItemEl.createEl("div", {
      cls: "wb-omni-item-path",
      text: this.path
    });
    const itemListEl = wbOmniSearchItemEl.createEl("div", {
      cls: "wb-omni-item-content-list"
    });
    const file = app.vault.getAbstractFileByPath(this.path);
    let content = "";
    if (file instanceof import_obsidian5.TFile)
      content = await app.vault.cachedRead(file);
    if (!file)
      return;
    const contentSearch = new SplitContent(content);
    if (this.matches.length > 0) {
      this.matches.forEach((word) => {
        const textEl = itemListEl.createEl("div", {
          cls: "wb-content-list-text"
        });
        textEl.innerHTML = contentSearch.search(word.offset, true);
      });
    }
  }
};

// src/component/OmniSearchContainer.ts
var OmniSearchContainer = class {
  constructor(leaf, plugin) {
    this.plugin = plugin;
    this.leaf = leaf;
  }
  onload() {
    this.wbOmniSearchCtnEl = this.leaf.view.contentEl.createEl("div", {
      cls: "wb-omni-box"
    });
    this.hide();
  }
  hide() {
    if (this.wbOmniSearchCtnEl.isShown())
      this.wbOmniSearchCtnEl.hide();
  }
  show() {
    if (!this.wbOmniSearchCtnEl.isShown())
      this.wbOmniSearchCtnEl.show();
  }
  notFound() {
    this.wbOmniSearchCtnEl.empty();
    this.wbOmniSearchCtnEl.createEl("div", {
      text: "No results found",
      cls: "wb-omni-item-notfound"
    });
  }
  tick(result) {
    if (this.result !== result)
      this.result = result;
    if (this.result !== result)
      this.result = result;
    if (!this.result || this.result?.length === 0) {
      this.show();
      this.notFound();
      return;
    }
    if (this.result.length > 0) {
      if (!this.result[0].foundWords.find((word) => word === this.query)) {
        this.notFound();
        return;
      }
      this.show();
      this.result.forEach((item) => {
        new OmniSearchItem(this.wbOmniSearchCtnEl, item.path, item.foundWords, item.matches).onload();
      });
    }
  }
  async update(query) {
    if (this.query === query)
      return;
    this.wbOmniSearchCtnEl.empty();
    this.query = query;
    const result = await omnisearch?.search(this.query);
    this.tick(result);
    if (!result || result?.length === 0) {
      setTimeout(async () => {
        const result2 = await omnisearch.search(this.query);
        this.tick(result2);
      }, 3e3);
    }
  }
  onunload() {
    this.wbOmniSearchCtnEl.empty();
    this.wbOmniSearchCtnEl.detach();
  }
};

